import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import axios from "axios";

import { Home, Navbar, FindStock } from "./";
const Main = () => {
  const apiKey = "R1Q7XP8H7N1WSGMG";

  return (
    <div>
      <Router>
        <div>
          <h1>My App</h1>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/stock">Stock Tracker</Link>
            </li>
          </ul>

          <hr />
          <Routes>
            <Route exact path="/" render={() => <Home />} />
            <Route path="/stock" component={FindStock} />
          </Routes>
        </div>
      </Router>
    </div>
  );
};

export default Main;
